export const registerFunction = async (data) => {
    try {
        const url = 'http://localhost:3977/api/v1/auth/register'

        const params = {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json'
            },
            body: JSON.stringify(data),
        };

    } catch (error) {
        throw error
    };
};
